O levantamento dos dados para IA devem obedecer as seguintes premissas:

1. Consenso sobre as propostas de utilização da IA no projeto;
2. Desenho das estruturas de dados necessárias para as entregas propostas;
3. Desenvolvimento de metodologias de coleta, armazenagem e disponibilização desses dados;

---
**RF-1.** O sistema IHR-SE deve possuir uma tela de login, onde o usuário irá efetuar seu acesso ao sistema. A tela de login deve:
**RF-1.1** Em caso de login e senha válidos: redirecionar para a página principal do sistema;
**RF-1.2** Quando o usuário não digitar login: o sistema deve emitir um alerta informando que login é obrigatório;
**RF-1.3** Quando o usuário não digitar senha: o sistema deve emitir um alerta informando que a senha é obrigatório;
**RF-1.4** Quando o usuário informar login ou senha inválidos: deve emitir um alerta informando que login/senha estão incorretos;
